import React from "react";
import "../../index.css";
import { Card, Image, Icon } from "semantic-ui-react";
function CustomCard({ src, title, date, time, description }) {
  return (
    <Card raise>
      <Image src={src} wrapped size="small" ui={false} />
      <Card.Content>
        <Card.Header>
          <h3>{title}</h3>
        </Card.Header>
        <Card.Meta>
          <span>Did it in: {date}</span>
        </Card.Meta>
        <Card.Description>{description}</Card.Description>
      </Card.Content>
      <Card.Content extra>
        <p href="#test">
          <Icon name="time" />
          Time to build this app: {time}hrs
        </p>
      </Card.Content>
    </Card>
  );
}

export default CustomCard;
